import React from 'react';

const styles= {
    htmlstart: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '10%',
    },
    bodystart: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '15%',
    },
    h1start: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '20%',
    },
    h1end: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '20%',
    },
    bodyend: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '15%',
    },
    htmlend: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '10%',
    },
    tags: {
        color: 'grey',
        fontFamily: "cursive"
    },
    h1: {
        color: 'white'
    }
}
const tags = {
    htmlstart: "<html>",
    bodystart: "<body>",
    h1start: "<h1>",
    htmlend: "</html>",
    bodyend: "</body>",
    h1end: "</h1>",

}
const Landing = () => {

    return(

        <>
        <p style={styles.htmlstart}>{tags.htmlstart}</p>
        <p style={styles.bodystart}>{tags.bodystart}</p>
        <p style={styles.h1start}>{tags.h1start}</p>
        <h1 style={styles.h1}>Chase Lipscomb,</h1>
        <h1 style={styles.h1}>Web Developer</h1>
        <p style={styles.h1end}>{tags.h1end}</p>
        <p style={styles.bodyend}>{tags.bodyend}</p>
        <p style={styles.htmlend}>{tags.htmlend}</p>

        </>
    )
}
export default Landing
